  methods: {
    createNavBar2() {
      let rawData = d3.tsvParse(this.tsvString, (d, i, columns) => {
        return {
          name: d.name.replace(/, ([\w-]+).*/, " $1"),
          values: columns.slice(1).map(k => +d[k])
        }
      })

      let data = {
        y: "% Unemployment",
        series: rawData,
        dates: rawData.columns.slice(1).map(d3.utcParse("%Y-%m"))
      }

      let xScale = d3
        .scaleUtc()
        .domain(d3.extent(data.dates))
        .range([
          this.lineChartMargin.left,
          this.width - this.lineChartMargin.right
        ])

      let yScale = d3
        .scaleLinear()
        .domain([0, d3.max(data.series, d => d3.max(d.values))])
        .nice()
        .range([
          this.height - this.lineChartMargin.bottom,
          this.lineChartMargin.top
        ])

      let xAxis = g =>
        g
          .attr(
            "transform",
            `translate(0,${this.height - this.lineChartMargin.bottom})`
          )
          .call(
            d3
              .axisBottom(xScale)
              .ticks(this.width / 80)
              .tickSizeOuter(0)
          )

      // let yAxis = g =>
      //   g
      //     .attr("transform", `translate(${this.lineChartMargin.left},0)`)
      //     .call(d3.axisLeft(yScale))
