      //       g
      //         .select(".tick:last-of-type text")
      //         .clone()
      //         .attr("x", 3)
      //         .attr("text-anchor", "start")
      //         .attr("font-weight", "bold")
      //         .text(data.yScale)
      //     )

      let line = d3
        .line()
        .defined(d => !isNaN(d))
        .x((d, i) => xScale(data.dates[i]))
        .y(d => yScale(d))

      const svg = d3
        .select("#p-nav-bar")
        .append("svg")
        .attr("viewBox", [0, 0, this.width, this.height])

      // svg.append("g").call(xAxis)
      //
      // svg.append("g").call(yAxis)

