        .append("g")
        .attr("fill", "none")
        .attr("stroke", "steelblue")
        .attr("stroke-width", 1.5)
        .attr("stroke-linejoin", "round")
        .attr("stroke-linecap", "round")
        .selectAll("path")
        .data(data.series)
        .join("path")
        .style("mix-blend-mode", "multiply")
        .attr("d", d => line(d.values))

      const brush = d3.brushX().extent([
        [this.lineChartMargin.left, this.lineChartMargin.top],
        [
          this.width - this.lineChartMargin.right,
          this.height - this.lineChartMargin.bottom
        ]
      ])

      brush.on("brush", () => {
        // console.log("brush moved")
        // console.log(brush.extent()(0))
        // console.log(brush.extent()(1))
        // console.log(d3.brushSelection(svg.node()))
        if (d3.event.selection) {
          console.table(d3.event.selection)
        }
      })

      svg.append("g").call(xAxis)

      svg
        .append("g")
        .call(brush)
        .call(brush.move, [3, 5].map(xScale))
        .call(g =>
          g
            .select(".overlay")
            .datum({ type: "selection" })
            .on("mousedown touchstart", beforeBrushStarted)
        )

      // Use a fixed width when re-centering.
      function beforeBrushStarted() {
        let dateParser = d3.utcParse("%Y-%m")
        // console.log(dateParser("2002-01"))
        // console.log(xScale(dateParser("2002-01")))
        // console.log(xScale(dateParser("2001-01")))

        const dx = xScale(dateParser("2002-01")) - xScale(dateParser("2001-01"))
        const [cx] = d3.mouse(this)
        const [x0, x1] = [cx - dx / 2, cx + dx / 2]
        const [X0, X1] = xScale.range()
        d3.select(this.parentNode).call(
          brush.move,
          x1 > X1 ? [X1 - dx, X1] : x0 < X0 ? [X0, X0 + dx] : [x0, x1]
        )
      }

      return svg.node()
    },
    // old nav bar using random data
    createNavBar() {
      let xScale = d3.scaleLinear(
        [0, 100],
        [this.margin.left, this.width - this.margin.right]
      )

      // let xScale = d3
      //   .scaleLinear()
      //   .domain([10, 130])
      //   .range([0, 960])

      // let rx = d3.randomUniform(...xScale.domain())
      // let ry = d3.randomNormal(this.height / 2, this.height / 12)
      let xAxis = g =>
        g
          .attr("transform", `translate(0,${this.height - this.margin.bottom})`)
          .call(d3.axisBottom(xScale))

      const svg = d3
        .select("#p-nav-bar")
        .append("svg")
        .attr("viewBox", [0, 0, this.width, this.height])

      const brush = d3.brushX().extent([
        [this.margin.left, this.margin.top],
        [this.width - this.margin.right, this.height - this.margin.bottom]
      ])
      // .on("start brush end", brushed)

      // const circle = svg
      //   .append("g")
      //   .attr("fill-opacity", 0.2)
      //   .selectAll("circle")
      //   .data(Float64Array.from({ length: 800 }, rx))
      //   .join("circle")
      //   .attr("transform", d => `translate(${xScale(d)},${ry()})`)
      //   .attr("r", 3.5)

      svg.append("g").call(xAxis)

      svg
        .append("g")
        .call(brush)
        .call(brush.move, [3, 5].map(xScale))
        .call(g =>
          g
            .select(".overlay")
            .datum({ type: "selection" })
            .on("mousedown touchstart", beforeBrushStarted)
        )

      function beforeBrushStarted() {
        const dx = xScale(1) - xScale(0) // Use a fixed width when recentering.
        const [cx] = d3.mouse(this)
        const [x0, x1] = [cx - dx / 2, cx + dx / 2]
        const [X0, X1] = xScale.range()
        d3.select(this.parentNode).call(
          brush.move,
          x1 > X1 ? [X1 - dx, X1] : x0 < X0 ? [X0, X0 + dx] : [x0, x1]
        )
      }

      // function brushed() {
      //   const selection = d3.event.selection
      //   if (selection === null) {
      //     circle.attr("stroke", null)
      //   } else {
      //     const [x0, x1] = selection.map(xScale.invert)
      //     circle.attr("stroke", d => (x0 <= d && d <= x1 ? "red" : null))
      //   }
      // }

      return svg.node()
    },
    createLineChart() {
      let rawData = d3.tsvParse(this.tsvString, (d, i, columns) => {
        return {
          name: d.name.replace(/, ([\w-]+).*/, " $1"),
          values: columns.slice(1).map(k => +d[k])
        }
      })

      let data = {
        y: "% Unemployment",
        series: rawData,
        dates: rawData.columns.slice(1).map(d3.utcParse("%Y-%m"))
      }

      let xScale = d3
        .scaleUtc()
        .domain(d3.extent(data.dates))
        .range([
          this.lineChartMargin.left,
          this.width - this.lineChartMargin.right
        ])

      let yScale = d3
        .scaleLinear()
        .domain([0, d3.max(data.series, d => d3.max(d.values))])
        .nice()
        .range([
          this.lineChartHeight - this.lineChartMargin.bottom,
          this.lineChartMargin.top
        ])

      let xAxis = g =>
        g
          .attr(
            "transform",
            `translate(0,${this.lineChartHeight - this.lineChartMargin.bottom})`
          )
          .call(
            d3
              .axisBottom(xScale)
              .ticks(this.width / 80)
              .tickSizeOuter(0)
          )

      let yAxis = g =>
        g
          .attr("transform", `translate(${this.lineChartMargin.left},0)`)
          .call(d3.axisLeft(yScale))
          .call(g => g.select(".domain").remove())
          .call(g =>
            g
              .select(".tick:last-of-type text")
              .clone()
              .attr("x", 3)
              .attr("text-anchor", "start")
              .attr("font-weight", "bold")
              .text(data.y)
          )

      let line = d3
        .line()
        .defined(d => !isNaN(d))
        .x((d, i) => xScale(data.dates[i]))
        .y(d => yScale(d))

      const svg = d3
        .select("#p-line-chart")
        .append("svg")
        .attr("viewBox", [0, 0, this.width, this.lineChartHeight])

      svg.append("g").call(xAxis)

      svg.append("g").call(yAxis)

      const path = svg
        .append("g")
        .attr("fill", "none")
        .attr("stroke", "steelblue")
        .attr("stroke-width", 1.5)
        .attr("stroke-linejoin", "round")
        .attr("stroke-linecap", "round")
        .selectAll("path")
        .data(data.series)
        .join("path")
        .style("mix-blend-mode", "multiply")
        .attr("d", d => line(d.values))

      svg.call(hover, path)

      return svg.node()

      function hover(svg, path) {
        svg.style("position", "relative")

        if ("ontouchstart" in document)
          svg
            .style("-webkit-tap-highlight-color", "transparent")
            .on("touchmove", moved)
            .on("touchstart", entered)
            .on("touchend", left)
        else
          svg
            .on("mousemove", moved)
            .on("mouseenter", entered)
            .on("mouseleave", left)

        const dot = svg.append("g").attr("display", "none")
        // const gx = svg.append("g").call(xAxis, xScale)

        dot.append("circle").attr("r", 2.5)

        dot
          .append("text")
          .style("font", "10px sans-serif")
          .attr("text-anchor", "middle")
          .attr("y", -8)

        function moved() {
          d3.event.preventDefault()
          const ym = yScale.invert(d3.event.layerY)
          const xm = xScale.invert(d3.event.layerX)
          const i1 = d3.bisectLeft(data.dates, xm, 1)
          const i0 = i1 - 1
          const i = xm - data.dates[i0] > data.dates[i1] - xm ? i1 : i0
          const s = data.series.reduce((a, b) =>
            Math.abs(a.values[i] - ym) < Math.abs(b.values[i] - ym) ? a : b
          )
          path
            .attr("stroke", d => (d === s ? null : "#ddd"))
            .filter(d => d === s)
            .raise()
          dot.attr(
            "transform",
            `translate(${xScale(data.dates[i])},${yScale(s.values[i])})`
          )
          dot.select("text").text(s.name)
        }

        function entered() {
          path.style("mix-blend-mode", null).attr("stroke", "#ddd")
          dot.attr("display", null)
        }

        function left() {
          path.style("mix-blend-mode", "multiply").attr("stroke", null)
          dot.attr("display", "none")
        }
      }
    }
  }
}
</script>

